admin = function(action) {
  if (!delta.state) {
    delta.state = {};
  }
  delta.state.adminAction = action;
}

function log(message) {
  if (!delta.state) {
    delta.state = {};
  }
  delta.state.log = message;
}

function distanceTo(a) {
  return Math.sqrt(a[0] * a[0] + a[1] * a[1]);
}

function angleTo(a) {
  return Math.atan2(-a[0], a[1]);
  return 0.2;
}

function distanceToPlayer() {
  if (perspective.closestPlayer) {
    return distanceTo(perspective.closestPlayer);
  } else {
    return 100.0;
  }
}

function angleToPlayer() {
  if (perspective.closestPlayer) {
    return angleTo(perspective.closestPlayer);
  } else {
    return null;
  }
}

function distanceToBeacon() {
  if (perspective.closestBeacon) {
    return distanceTo(perspective.closestBeacon);
  } else {
    return 100.0;
  }
}

function angleToBeacon() {
  if (perspective.closestBeacon) {
    return angleTo(perspective.closestBeacon);
  } else {
    return null;
  }
}

function grab() {
  if (!perspective.isLifting) {
    if (!delta.state) {
      delta.state = {};
    }
    delta.state.action = 1;
  }
}

function drop() {
  if (perspective.isLifting) {
    if (!delta.state) {
      delta.state = {};
    }
    delta.state.action = 1;
  }
}

function isLifted() {
  return perspective.isLifted;
}

function isLifting() {
  return perspective.isLifting;
}

var dx;
var dy;
resetTurn = function() {
  dx = 0;
  dy = 0;
}
goNorth = function() {
  delta.drive = 1.0;
  dy = -1
}
goSouth = function() {
  delta.drive = 1.0;
  dy = 1
}
goEast = function() {
  delta.drive = 1.0;
  dx = -1
}
goWest = function() {
  delta.drive = 1.0;
  dx = 1
}

function subtractAngles(a, b) {
  let result = a - b;
  result = (result + Math.PI) % (Math.PI * 2) - Math.PI;
  return result;
}
setTurn = function() {
  let desiredAngle = 0;
  if (dx != 0 || dy != 0) {
    desiredAngle = Math.atan2(dx, dy);
  }
  delta.turn = subtractAngles(desiredAngle, perspective.currentHeading);
  delta.turn /= Math.PI;
}

